@MBaihel @Mamiebretagne1 @JournalPapotin @France2tv L'extrême-gauche, c'est Poutou et Arthaud. Et même eux ne sont pas une menace pour la démocratie.
Ce glissement sémantique mettant toute la gauche dans une extrême-gauche est une manie déplaisante.
Est-ce que Philippe et Larcher sont qualifiés d'extrême-droite ?
